import React, { Component } from 'react';
import './styles.scss';

class Footer extends Component {
  render() {
    return (
      <div className="footer">
        <p>Grok 2018</p>
        <p className="right">Created By: Doug, Harsh, Sarah, & Wymin</p>
      </div>
    )
  }
}

export default Footer
